import './ExpenseItem.css';

// Using double underscores in the classnames
// Components only receive ONE parameter, which is an object, that we need to dissect into properties

function ExpenseItem (props) {
    const expenseDate = new Date (2021, 4, 17, 16, 40);
    const expenseTitle = 'Car insurance';
    const expenseAmount = 249;

    return (
        <div className="expense-item">
          <div>{expenseDate.toISOString()}</div>
          <div className="expense-item__description"> 
            <h2>{expenseTitle}</h2>
            <div className="expense-item__price">${expenseAmount}</div>
          </div>
        </div>
      );
}

export default ExpenseItem;
